import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import TodoItem from './components/TodoItem';

class App extends Component {
  todoItems = [
    'Di lam',
    'An com trua',
    'An com toi',
    'Choi game'
  ]
  render() {
    return (
      <div className="App">
        <TodoItem title="Di lam" />
        <TodoItem title="Di an com" />
        <TodoItem title="Di an com toi" />
      </div>
    );
  }
}

export default App;
